import React from 'react';
import { Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <Container className="mt-5 text-center">
      <h2>Welcome to the Emergency Response Management System</h2>
      <p>Here you can report emergencies and responders can manage the incidents effectively.</p>
      <Link to="/register" className="btn btn-primary m-2">Register</Link>
      <Link to="/login" className="btn btn-secondary m-2">Login</Link>
    </Container>
  );
};

export default HomePage;
